import styled from "styled-components";
import Imagem from "../assets/img/Captura de tela 2022-08-03 195204.png"

export default function Navbar(){
    return(
        <Topo>
            TrackIt
            <Foto src={Imagem}/>
        </Topo>
    )
}

const Topo = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 100vw;
    height: 70px;
    left: 0px;
    top: 0px;
    background: #126BA5;
    box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.15);
    font-family: 'Playball';
    font-style: normal;
    font-weight: 400;
    font-size: 38.982px;
    line-height: 49px;
    color: #FFFFFF;
    padding-left: 18px;
    padding-right: 18px;
`
const Foto= styled.div`
    width: 51px;
    height: 51px;
    border-radius: 98.5px;
`
